message:
ATENÇÃO 🚨🚨🆘🚨🆘

@Adms vcs não viram isso???????????? Ajustem as mensagens para 24h. Estão esperando oq??

Recebi esse áudio de outro grupo, como sugestão

BALANÇO DE DOS 3 PRIMEIROS DIAS DO CONDENADO NO PODER:

1 - Petrobras perdeu 117 Bilhões; 

2 - Outras estatais 97 bilhões em desvalorização;

3 - Bolsas não param de cair (quase 200 bilhões em perdas);

4 - Revogada 8 privatizações (Prejuízo de quase 1 trilhão aos cofres);

5 - Desarmamento do cidadão de bem (fortalecendo os bandidos);

6 - Criação da Procuradoria Nacional da Defesa e Democracia - Jorge Messias o tal “Bessias” da lava jato. A verdadeira censura;

7 - 10 bilhões para cultura, porém 1,5 bi para o Agronegócio (Óbvio que indica o favorecimento para invasões do MST) ou será que teremos que comer artistas?  

8 - Empresas da Lava Jato voltarão a exercer serviços públicos (principalmente as 8 onde o Lula foi provado nos esquemas);

9 - Nova ministra da saúde anuncia fim de posições pró vida (em resumo a favor do aborto);

10 - O ministro da educação acaba com o programa de alfabetização;

11 - O ministro das forças armadas demite 8 mil militares do exército;

12 - Nenhum pronunciamento ou projeto apresentado contra corrupção, ou seja, não dou 30 dias já tem escândalo. 

13 - A passagem de 23 para 37 ministérios com um custo anual a mais de R$ 687 milhões;

14- A extinção da Secretaria de Educação para Surdos.


Essa culpa eu não carrego mesmo. 

Mas aqueles que fizeram o elli são cúmplices de tudo que acontecerá de pior...
